package communication

import (
	"bufio"
	"bytes"
	"fmt"
	"testing"

	"github.com/magiconair/properties/assert"
)

func checkReadWrite(s []byte, t *testing.T) {
	fmt.Printf("Source data: [%x] \n", s)

	encoded := EncodeDelimited(s)
	fmt.Printf("Encoded data: [%x] \n", encoded)

	r1 := bytes.NewReader(encoded)

	reader := bufio.NewReader(r1)

	res, err := ReadFromReader(reader)
	if err != nil {
		panic(err)
	}

	fmt.Printf("Read data: [%x] \n", res)
	assert.Equal(t, s, res)
}

func TestCommunication(t *testing.T) {
	checkReadWrite([]byte(""), t)
	checkReadWrite([]byte("73"), t)
	checkReadWrite([]byte("01010101"), t)
	s := []byte("")
	checkReadWrite(s, t)
}
